import React from 'react';



export default function Live ({liveSong}){
    console.log(liveSong)
    return (
        <div>
            { liveSong.map((line, index)=>(
               <p key={index}>
                { line.map((word, index)=>(
                   <>
                    <span></span>
                    <span key={index}>{ word.lyrics }  </span>
                   </>
                ))}
               </p>
            ))}
        </div>
    );
};
